import React, { Component } from 'react';
import Item from '../Item'
import './index.css'

class index extends Component {
    render() {
        const {todos} = this.props
        return (
            <ul className="todo-main">
                {
                    todos.map((todo)=>{
                        return <Item key={todo.id} {...todo}/>
                    })
                }
            </ul>
        );
    }
}

export default index;
